"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[8580],{50832:(e,t,a)=>{a.r(t),a.d(t,{default:()=>s,johnChapter8PL:()=>n});const n={chapter:8,title:"Jean 8",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"A Jezus szed\u0142 na g\xf3r\u0119 Oliwn\u0105.",strong:[{text:"montagne",strong:"G3735",start:21,end:29}]},{number:2,text:"A rano za\u015b przyszed\u0142 do ko\u015bcio\u0142a, i wszystek lud schodzi\u0142 si\u0119 do niego, a on usiad\u0142szy, naucza\u0142 ich.",strong:[{text:"nouveau",strong:"G2537",start:31,end:38},{text:"dans",strong:"H6887",start:39,end:43},{text:"tout",strong:"G3956",start:58,end:62},{text:"peuple",strong:"G1484",start:66,end:72}]},{number:3,text:"I przywiedli do niego nauczeni w Pi\u015bmie i Faryzeuszowie niewiast\u0119 w cudzo\u0142\xf3stwie pojman\u0105, a postawiwszy j\u0105 w po\u015brodku,",strong:[{text:"amen",strong:"G281",start:36,end:40}]},{number:4,text:"Rzekli mu: Mistrzu! ta niewiasta jest teraz pojmana w jawnym cudzo\u0142\xf3stwie.",strong:[{text:"peuple",strong:"G1484",start:28,end:34},{text:"cette",strong:"G3778",start:64,end:69}]},{number:5,text:"A w zakonie nam Moj\u017cesz rozkaza\u0142 takowe kamionowa\u0107; ty tedy co powiadasz?",strong:[{text:"dans",strong:"H6887",start:7,end:11}]},{number:6,text:"(A to m\xf3wili, kusz\u0105c go, aby mieli, czem by na\u0144 skar\u017cyli.) Ale Jezus nachyliwszy si\u0119 na d\xf3\u0142, pisa\u0142 palcem po ziemi.",strong:[{text:"avec",strong:"G1848",start:99,end:103},{text:"terre",strong:"H776",start:120,end:125}]},{number:7,text:"A gdy go ustawicznie pytali, wzni\xf3s\u0142szy si\u0119, rzek\u0142 im: Kto jest z was bez grzechu, niech pierwej rzuci na ni\u0105 kamieniem.",strong:[{text:"Comme",strong:"G2531",start:0,end:5},{text:"interroger",strong:"G2065",start:27,end:37},{text:"premier",strong:"G4413",start:111,end:118},{text:"contre",strong:"G2596",start:129,end:135}]},{number:8,text:"A zasi\u0119 nachyliwszy si\u0119 na d\xf3\u0142, pisa\u0142 po ziemi.",strong:[{text:"nouveau",strong:"G2537",start:14,end:21},{text:"terre",strong:"H776",start:49,end:54}]},{number:9,text:"A oni us\u0142yszawszy to, i b\u0119d\u0105c przez sumienie po\u015bwiadczeni, jeden po drugim wychodzili, pocz\u0105wszy od starszych a\u017c do ostatnich; i zosta\u0142 sam Jezus, a niewiasta w po\u015brodku stoj\u0105ca.",strong:[{text:"seul",strong:"G3439",start:140,end:144},{text:"avec",strong:"G1848",start:145,end:149}]},{number:10,text:"A Jezus podni\xf3s\u0142szy si\u0119, i nie ujrzawszy nikogo, tylko niewiasty, rzek\u0142 jej: Niewiasto! gdzie\u017c s\u0105 oni, kt\xf3rzy na ci\u0119 skar\u017cyli? \u017baden ci\u0119 nie pot\u0119pi\u0142?",strong:[{text:"Personne",strong:"G3762",start:107,end:115}]},{number:11,text:"A ona rzek\u0142a: \u017baden, Panie! I rzek\u0142 jej Jezus: I ja\u0107 ci\u0119 nie pot\u0119piam; id\u017a, a ju\u017c wi\u0119cej nie grzesz.",strong:[{text:"Seigneur",strong:"G2962",start:20,end:28}]},{number:12,text:"Tedy im zasi\u0119 m\xf3wi\u0142 Jezus, i rzek\u0142: Jam jest \u015bwiat\u0142o\u015b\u0107 \u015bwiata; kto za mn\u0105 idzie, nie b\u0119dzie chodzi\u0142 w ciemno\u015bci, ale b\u0119dzie mia\u0142 \u015bwiat\u0142o\u015b\u0107 \u017cywota.",strong:[{text:"nouveau",strong:"G2537",start:20,end:27},{text:"monde",strong:"G2889",start:59,end:64},{text:"dans",strong:"H6887",start:100,end:104}]},{number:13,text:"I rzekli mu Faryzeuszowie: Ty sam o sobie \u015bwiadczysz; \u015bwiadectwo twoje nie jest prawdziwe.",strong:[]},{number:14,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 im: Aczkolwiek ja \u015bwiadcz\u0119 sam o sobie, prawdziwe jest \u015bwiadectwo moje; bo wiem, sk\u0105d przyszed\u0142em, i dok\u0105d id\u0119; ale wy nie wiecie, sk\u0105d przychodz\u0119, albo dok\u0105d id\u0119.",strong:[]},{number:15,text:"Wy wed\u0142ug cia\u0142a s\u0105dzicie, ja nie s\u0105dz\u0119 nikogo.",strong:[{text:"selon",strong:"G2531",start:11,end:16},{text:"chair",strong:"G4561",start:20,end:25},{text:"personne",strong:"G3762",start:43,end:51}]},{number:16,text:"A cho\u0107bym ja i s\u0105dzi\u0142, s\u0105d m\xf3j prawdziwy jest; bom nie sam, ale ja i Ojciec, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[{text:"jugement",strong:"G2920",start:19,end:27},{text:"seul",strong:"G3439",start:57,end:61},{text:"avec",strong:"G1848",start:95,end:99}]},{number:17,text:"A w zakonie waszym napisano, i\u017c dw\xf3ch ludzi \u015bwiadectwo prawdziwe jest.",strong:[{text:"dans",strong:"H6887",start:13,end:17},{text:"deux",strong:"G1417",start:49,end:53}]},{number:18,text:"Jam jest, kt\xf3ry \u015bwiadcz\u0119 sam o sobie, i \u015bwiadczy o mnie Ojciec, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[]},{number:19,text:"Tedy mu m\xf3wili: Gdzie\u017c jest Ojciec tw\xf3j? Odpowiedzia\u0142 Jezus: Ani mnie znacie, ani Ojca mego; by\u015bcie mi\u0119 znali, i Ojca mego znaliby\u015bcie.",strong:[]},{number:20,text:"Te s\u0142owa m\xf3wi\u0142 Jezus u skarbnicy, nauczaj\u0105c w ko\u015bciele, a \u017caden go nie pojma\u0142; bo jeszcze nie by\u0142a przysz\u0142a godzina jego.",strong:[{text:"enseignant",strong:"G1320",start:23,end:33},{text:"dans",strong:"H6887",start:34,end:38},{text:"personne",strong:"G3762",start:81,end:89}]},{number:21,text:"I rzek\u0142 im zasi\u0119 Jezus: Ja odchodz\u0119, a szuka\u0107 mi\u0119 b\u0119dziecie, i w grzechu waszym pomrzecie; dok\u0105d ja id\u0119, wy przyj\u015b\u0107 nie mo\u017cecie.",strong:[{text:"dans",strong:"H6887",start:76,end:80}]},{number:22,text:"Tedy m\xf3wili \u017bydowie: Aza\u017c si\u0119 sam zabije, \u017ce m\xf3wi: Dok\u0105d ja id\u0119, wy przyj\u015b\u0107 nie mo\u017cecie?",strong:[]},{number:23,text:"I rzek\u0142 im: Wy jeste\u015bcie z niska, ja jestem z wysoko\u015bci; wy jeste\u015bcie z tego \u015bwiata, ja nie jestem z tego \u015bwiata.",strong:[{text:"monde",strong:"G2889",start:76,end:81},{text:"monde",strong:"G2889",start:109,end:114}]},{number:24,text:"Przeto\u017cem wam powiedzia\u0142, \u017ce pomrzecie w grzechach waszych; bo je\u017ali nie uwierzycie, \u017cem ja jest, pomrzecie w grzechach waszych.",strong:[{text:"dans",strong:"H6887",start:47,end:51},{text:"dans",strong:"H6887",start:119,end:123}]},{number:25,text:"Tedy mu m\xf3wili: Ty\u015b ty kto? I rzek\u0142 im Jezus: Pocz\u0105tkiem, kt\xf3rym i wam m\xf3wi\u0119.",strong:[{text:"commencement",strong:"G746",start:74,end:86}]},{number:26,text:"Wielem o was m\xf3wi\u0107 i s\u0105dzi\u0107; ale kt\xf3ry mi\u0119 pos\u0142a\u0142, prawdziwy jest, a ja, com s\u0142ysza\u0142 od niego, to m\xf3wi\u0119 na \u015bwiecie.",strong:[{text:"beaucoup",strong:"G4183",start:5,end:13},{text:"dire",strong:"H559",start:26,end:30},{text:"juger",strong:"G2919",start:44,end:49},{text:"monde",strong:"G2889",start:139,end:144}]},{number:27,text:"A nie zrozumieli, \u017ce im o Ojcu m\xf3wi\u0142.",strong:[]},{number:28,text:"Przeto\u017c rzek\u0142 im Jezus: Gdy wywy\u017cszycie Syna cz\u0142owieczego, tedy poznacie, \u017cem ja jest, a nic sam od siebie nie czyni\u0119, ale jako mi\u0119 nauczy\u0142 Ojciec m\xf3j, tak m\xf3wi\u0119.",strong:[{text:"Fils",strong:"G5207",start:47,end:51},{text:"homme",strong:"G444",start:57,end:62},{text:"rien",strong:"G3762",start:120,end:124},{text:"selon",strong:"G2531",start:156,end:161}]},{number:29,text:"A ten, kt\xf3ry mi\u0119 pos\u0142a\u0142, ze mn\u0105 jest; nie zostawi\u0142 mi\u0119 sam Ojciec; bom ja to, co mu si\u0119 podoba, zawsze czyni\u0142.",strong:[{text:"avec",strong:"G1848",start:25,end:29},{text:"seul",strong:"G3439",start:56,end:60},{text:"toujours",strong:"H5769",start:80,end:88}]},{number:30,text:"Gdy to m\xf3wi\u0142, wiele ich uwierzy\u0142o we\u0144.",strong:[{text:"Comme",strong:"G2531",start:0,end:5}]},{number:31,text:"Tedy m\xf3wi\u0142 Jezus do onych \u017byd\xf3w, kt\xf3rzy we\u0144 uwierzyli: Je\u017ali wy b\u0119dziecie trwali w s\u0142owie mojem, prawdziwie uczniowie moi b\u0119dziecie;",strong:[{text:"dans",strong:"H6887",start:61,end:65},{text:"parole",strong:"G3056",start:69,end:75}]},{number:32,text:"I poznacie prawd\u0119, a prawda was wyswobodzi.",strong:[]},{number:33,text:"Odpowiedzieli mu: Nasienie Abrahamowe jeste\u015bmy, a nikomu\u015bmy nigdy nie s\u0142u\u017cyli; jako\u017c ty m\xf3wisz: \u017be b\u0119dziecie wolni?",strong:[{text:"Abraham",strong:"G11",start:48,end:55},{text:"personne",strong:"G3762",start:93,end:101}]},{number:34,text:"Odpowiedzia\u0142 im Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam wam: \u017be ka\u017cdy, kt\xf3ry czyni grzech, niewolnik jest grzechu.",strong:[{text:"esclave",strong:"G1401",start:91,end:98}]},{number:35,text:"A niewolnik nie zostaje w domu na wieki, ale syn zostaje na wieki.",strong:[{text:"esclave",strong:"G1401",start:6,end:13},{text:"demeure",strong:"H1004",start:17,end:24},{text:"toujours",strong:"H5769",start:29,end:37},{text:"dans",strong:"H6887",start:38,end:42},{text:"maison",strong:"G3609",start:46,end:52},{text:"fils",strong:"G5207",start:57,end:61},{text:"demeure",strong:"H1004",start:64,end:71},{text:"toujours",strong:"H5769",start:72,end:80}]},{number:36,text:"A przeto\u017c je\u017aliby was Syn wyswobodzi\u0142, prawdziwie wolni b\u0119dziecie.",strong:[{text:"Fils",strong:"G5207",start:11,end:15}]},{number:37,text:"Wiem, \u017ce jeste\u015bcie nasienie Abrahamowe, ale szukacie mi\u0119 zabi\u0107; bo s\u0142owo moje nie ma miejsca w was.",strong:[{text:"Abraham",strong:"G11",start:37,end:44},{text:"faire",strong:"G1080",start:70,end:75},{text:"parole",strong:"G3056",start:97,end:103}]},{number:38,text:"Ja, com widzia\u0142 u Ojca mego, m\xf3wi\u0119; a wy, co\u015bcie s\u0142yszeli u ojca waszego, czynicie.",strong:[]},{number:39,text:"Odpowiedzieli i rzekli mu: Ojciec nasz Abraham jest. Rzek\u0142 im Jezus: By\u015bcie byli synami Abrahamowymi, uczynki Abrahamowe czyniliby\u015bcie.",strong:[{text:"Abraham",strong:"G11",start:39,end:46},{text:"Abraham",strong:"G11",start:88,end:95},{text:"Abraham",strong:"G11",start:122,end:129}]},{number:40,text:"Ale teraz szukacie mi\u0119 zabi\u0107, cz\u0142owieka, kt\xf3rym wam prawd\u0119 powiedzia\u0142, kt\xf3r\u0105m s\u0142ysza\u0142 od Boga; tego Abraham nie czyni\u0142.",strong:[{text:"faire",strong:"G1080",start:35,end:40},{text:"Dieu",strong:"G2316",start:100,end:104},{text:"Abraham",strong:"G11",start:112,end:119}]},{number:41,text:"Wy czynicie uczynki ojca waszego. Tedy mu rzekli: My\u015bmy z wszetecze\u0144stwa nie narodzeni; jednego ojca mamy, Boga.",strong:[{text:"seul",strong:"G3439",start:112,end:116},{text:"Dieu",strong:"G2316",start:123,end:127}]},{number:42,text:"Rzek\u0142 im tedy Jezus: By B\xf3g by\u0142 ojcem waszym, mi\u0142owaliby\u015bcie mi\u0119; bom ja od Boga wyszed\u0142, i przyszed\u0142em, anim przyszed\u0142 sam od siebie, ale on mi\u0119 pos\u0142a\u0142.",strong:[{text:"Dieu",strong:"G2316",start:19,end:23},{text:"Dieu",strong:"G2316",start:72,end:76}]},{number:43,text:"Przecz\u017ce mowy mojej nie znacie? \u017be nie mo\u017cecie s\u0142ucha\u0107 s\u0142owa mego.",strong:[{text:"langage",strong:"G1100",start:35,end:42},{text:"parole",strong:"G3056",start:80,end:86}]},{number:44,text:"Wy z ojca dyjab\u0142a jeste\u015bcie, a po\u017c\u0105dliwo\u015bci ojca waszego chcecie czyni\u0107. On by\u0142 m\u0119\u017cob\xf3jc\u0105 od pocz\u0105tku, a w prawdzie nie osta\u0142; bo prawdy w nim niemasz. Gdy m\xf3wi k\u0142amstwo, z swego w\u0142asnego m\xf3wi; bo k\u0142amca jest, i ojciec k\u0142amstwa.",strong:[{text:"accomplir",strong:"G4160",start:46,end:55},{text:"commencement",strong:"G746",start:108,end:120},{text:"dans",strong:"H6887",start:144,end:148},{text:"propre",strong:"G2398",start:247,end:253}]},{number:45,text:"Ale \u017ce ja prawd\u0119 m\xf3wi\u0119, nie wierzycie mi.",strong:[]},{number:46,text:"Kto z was mo\u017ce mi\u0119 winowa\u0107 o grzech? A je\u017alim prawd\u0119 m\xf3wi\u0119, przecz\u017ce wy mi nie wierzycie?",strong:[]},{number:47,text:"Kto jest z Boga, s\u0142\xf3w Bo\u017cych s\u0142ucha; dlatego wy nie s\u0142uchacie, i\u017c nie jeste\u015bcie z Boga.",strong:[{text:"Dieu",strong:"G2316",start:17,end:21},{text:"Dieu",strong:"G2316",start:44,end:48},{text:"Dieu",strong:"G2316",start:99,end:103}]},{number:48,text:"Tedy odpowiedzieli \u017bydowie i rzekli mu: Aza\u017c nie dobrze m\xf3wimy, \u017ce ty jeste\u015b Samarytanin, i dyjabelstwo masz?",strong:[{text:"raison",strong:"G3056",start:44,end:50},{text:"dire",strong:"H559",start:54,end:58}]},{number:49,text:"Odpowiedzia\u0142 Jezus: Ja dyjabelstwa nie mam, ale czcz\u0119 Ojca mego, a wy mi\u0119 l\u017cycie.",strong:[]},{number:50,text:"A ja nie szukam chwa\u0142y mojej; jest, kt\xf3ry szuka i s\u0105dzi.",strong:[]},{number:51,text:"Zaprawd\u0119, zaprawd\u0119 powiadam wam: Je\u017ali kto s\u0142owa mego strzedz b\u0119dzie, nie ujrzy \u015bmierci na wieki.",strong:[{text:"parole",strong:"G3056",start:60,end:66},{text:"mort",strong:"H6757",start:90,end:94}]},{number:52,text:"Tedy mu rzekli \u017bydowie: Teraz poznajemy, \u017ce dyjabelstwo masz. Abraham umar\u0142 i prorocy, a ty powiadasz: Je\u017ali kto s\u0142owa mego strzedz b\u0119dzie, nie ukusi \u015bmierci na wieki.",strong:[{text:"Abraham",strong:"G11",start:71,end:78},{text:"mort",strong:"H6757",start:83,end:87},{text:"parole",strong:"G3056",start:143,end:149},{text:"mort",strong:"H6757",start:173,end:177}]},{number:53,text:"Aza\u017c ty jeste\u015b wi\u0119tszy ni\u017c ojciec nasz Abraham, kt\xf3ry umar\u0142? i prorocy pomarli; kim\u017ce ty sam siebie czynisz?",strong:[{text:"grand",strong:"G3173",start:11,end:16},{text:"Abraham",strong:"G11",start:32,end:39},{text:"mort",strong:"H6757",start:49,end:53}]},{number:54,text:"Odpowiedzia\u0142 Jezus: Je\u017alibym ja sam siebie chlubi\u0142, nic nie jest chwa\u0142a moja; Ojciec m\xf3j jest, kt\xf3ry mi\u0119 chwali, o kt\xf3rym wy powiadacie, i\u017c Bogiem waszym jest.",strong:[{text:"rien",strong:"G3762",start:60,end:64},{text:"Dieu",strong:"G2316",start:128,end:132}]},{number:55,text:"A nie pozna\u015bcie go; ale ja go znam; a je\u017alibym powiedzia\u0142, \u017ce go nie znam, by\u0142bym k\u0142amc\u0105, podobnym wam; ale znam go, i s\u0142owa jego strzeg\u0119.",strong:[{text:"semblable",strong:"G3664",start:109,end:118},{text:"parole",strong:"G3056",start:174,end:180}]},{number:56,text:"Abraham, ojciec wasz, \u017c\u0105da\u0142, aby ujrza\u0142 dzie\u0144 m\xf3j; i ujrza\u0142, i weseli\u0142 si\u0119.",strong:[{text:"Abraham",strong:"G11",start:0,end:7},{text:"jour",strong:"H3117",start:66,end:70}]},{number:57,text:"Tedy mu rzekli \u017bydowie: Pi\u0119\u0107dziesi\u0119ciu lat jeszcze nie masz, a Abrahama widzia\u0142e\u015b?",strong:[{text:"Abraham",strong:"G11",start:68,end:75}]},{number:58,text:"Rzek\u0142 im Jezus: Zaprawd\u0119, zaprawd\u0119 powiadam wam: Pierwej ni\u017celi Abraham by\u0142, jam jest.",strong:[{text:"Abraham",strong:"G11",start:63,end:70}]},{number:59,text:"Tedy porwali kamienie, aby na\u0144 miotali; ale si\u0119 Jezus skry\u0142, i wyszed\u0142 z ko\u015bcio\u0142a, przeszed\u0142szy przez po\u015brodek ich, i tak uszed\u0142.",strong:[{text:"contre",strong:"G2596",start:50,end:56}]}]},s=n}}]);
